INSERT INTO dep_course VALUES("94","3","TMA-301","Mathematics-III","4","2010-07-10","Cross Department","<p>Apply the fundamental concepts of Ordinary Differential Equations and Partial Differential Equations and the basic numerical methods for their resolution. Solve the problems choosing the most suitable method. Understand the difficulty of solving problems analytically and the need to use numerical approximations for their resolution. Use computational tools to solve problems and applications of Ordinary Differential Equations and Partial Differential Equations. Formulate and solve differential equation problems in the field of Industrial Organisation Engineering. Use an adequate scientific language to formulate the basic concepts of the course.</p>
INSERT INTO dep_course VALUES("95","3","THU-301","Engineering Economics","3","2010-07-10","Cross Department","<p>Identify the type of interest simple compound preset worth comparison equivalent annual worth comparison shrinking fund application concepts using formulas compound interest tables. Knowledge of obtaining annual payment monthly payment cash flow diagram depreciation.</p>
INSERT INTO dep_course VALUES("96","3","TME-301","Material Science","3","2010-07-10","Core","<p>An understanding of types of structures, imperfections in metals, diffusion mechanism, evaluation of mechanical properties, basic concepts of phase transformation during solidification, phase diagrams, iron carbon equilibrium diagram, basic concepts of heat treatment process, composite materials.</p>
INSERT INTO dep_course VALUES("97","3","TME 302","Engineering Thermodynamics","3","2010-07-10","Core","<p>Understand the basic concepts like property, system, equilibrium, temperature, different forms of work and heat, able to analyze the first law of thermodynamics and second law of thermodynamics applicable to closed system and open system, able to apply first law apply first law of thermodynamics and second law of thermodynamics to pure substance, real and ideal gases.</p>
INSERT INTO dep_course VALUES("98","3","TCE 301","Fluid Mechanics","3","2010-07-10","Core","<p>Understand of the basic principles of and applications of fluid mechanics and knowledge of the different properties of the fluids and ability to solve problems related to manometers &amp; on submerged plane surfaces, basic concepts of buoyancy, kinematics and fluid dynamics, and ability to solve problems related to buoyancy, fluid kinematics and fluid dynamics, basic concepts involving fluid flow measuring equipments, friction in pipe flow and an ability to apply dimensional analysis, basic concepts of fluid statics and fluid dynamics, laminar and turbulent flows, compressible flow, lift and drag and ability to solve problems related to laminar and turbulent flows.</p>
INSERT INTO dep_course VALUES("99","3","TME-303","Solid Mechanics","3","2010-07-10","Core","<p>Students will have the knowledge of engineering properties of materials; fundamental concepts of stress an able to understand and analyze the Bending Moments and Shear Force diagrams and bending stresses involved in Beams, strain, Volumetric strain, Principle of superposition, elastic constants, Stresses in Composite Section. Able to understand and analyze the Compound Stresses, Mohr&#39;s circle, strain energy. Able to understand and analyze the Deflection of Beams, Torsion of Circular Shafts and Elastic Stability of Columns.</p>
INSERT INTO dep_course VALUES("100","3","PME 352","Machine Drawing","3","2010-07-10","Core","<p>Student will be able to sketch sections of solids of various polyhedrons, and also visualize and draw orthographic views of simple machine parts, various thread forms, standard keys, joints, couplings using memorable drawing. Alable to visualize and prepare detailed drawing of a given part and draw assembly of machine parts.</p>
INSERT INTO dep_course VALUES("101","3","PCE-351","Fluid Mechanics Lab","3","2010-07-10","Core","<p>Students will be able to understand basic units of measurement, identify and charaterize flow pattern regimes, practical understanding of equaltions of bernaulli theorem, frictional losses, venturimeter, orificemeter nad various other devices used for measuring flow properties.</p>
INSERT INTO dep_course VALUES("102","3","TME-401","Kinematics of Machines","3","2010-07-10","Core","<p>Students will be able to Know about link, kinematic pair, DOF, Chain, Mechanism and solve for mobility. Able to identify and examine for velocity &amp; acceleration for different mechanisms by graphical, analytical and instantaneous center methods.</p>
INSERT INTO dep_course VALUES("103","3","TME-402","Manufacturing Science-I","3","2010-07-10","Core","<p>Students will be able to understand various manufacturing processes including unconventional processes also, the different criteria to be considered for such processes, Jigs, fixtures, various foundary techniques of manufacturing also.</p>
INSERT INTO dep_course VALUES("104","3","TME-403","Mechanical Measurement","3","2010-07-10","Core","<p>Understanding various pressure, force, torque measurrment devices and their performance charactersitics. Caliberation of those devices and measurement of various geometric forms.</p>
INSERT INTO dep_course VALUES("105","3","TME-404","Applied Thermodynamics","3","2010-07-10","Core","<p>1. Students will be able to analyze a vapor power cycle given a set of operational parameters and constraints, determine cycle efficiency, its power output, and required heat input. 2. Students will be able to make modifications to improve the overall cycle efficiency for the steam power cycle. 3. Students will be able to analyze and optimize a vapor refrigeration system given the requirements and constraints of a refrigeration system. 4. Students will be able to understand the second law limitation of thermodynamic efficiencies and will be able to sort out realistic and unrealistic thermodynamic system claims. 5.Students will be able to analyze and determine cycle efficiency, work output and required heat input for a spark-ignition IC engine with a given set of operating parameters. 6. Students will be able to analyze and determine cycle efficiency, work output and required heat input for a diesel engine with a given set of operating parameters.</p>
INSERT INTO dep_course VALUES("106","3","TME-405","Industrial Engineering","3","2010-07-10","Core","<p>An ability for students to identify basic manufacturing processes and to ascertain the types ofproducts that are cost effectively produced with each process. The application of statistical analysis to manufacturing, including the computation of process capability and the understanding of statistical process control. The ability to list major metal alloy systems and their physical characteristics The ability to explain heat treating principles; quenching and tempering, solutionizing and aging, and annealing An ability for student to calculate material deformation energy. An ability to explain and calculate non-elastic (plastic) material behavior.</p>
INSERT INTO dep_course VALUES("107","3","TEE-405","Control System","3","2010-07-10","Cross Department","<p>Students who successfully complete the course will be able to: ? demonstrate an understanding of the fundamentals of (feedback) control systems. ? determine and use models of physical systems in forms suitable for use in the analysis and design of control systems. ? express and solve system equations in state-variable form (state variable models). ? determine the time and frequency-domain responses of first and second-order systems to step and sinusoidal (and to some extent, ramp) inputs. ? determine the (absolute) stability of a closed-loop control system ? apply root-locus technique to analyze and design control systems. ? communicate design results in written reports.</p>
INSERT INTO dep_course VALUES("108","3","PME-451","Manufacturing Science Lab","3","2010-07-10","Core","<p>At the end of the course, the student will be able to: Fabricate joints using gas welding and arc welding. Evaluate the quality of welded joints using non-destructive testing methods. Test the properties of moulding sands. Perform injection moulding studies on plastics.</p>
INSERT INTO dep_course VALUES("109","3","PME-452","Measurement & Metrology Lab","3","2010-07-10","Core","<p>At the end of the course, the student will be able to: Prepare setups and measure dimensional and geometrical features of components. Measure surface roughness of components.</p>
INSERT INTO dep_course VALUES("110","3","PME-453","Thermodynamics lab","3","2010-07-10","Core","<p>At the end of the course, the student will be able to: Understand the flow of heat in boilers and various other types of engines, their enhancement, formation of high pressure steam, application of heat in various types of other mechanical devices</p>
INSERT INTO dep_course VALUES("111","3","PEE- 454","Control System Lab","3","2010-07-10","Cross Department","<p>Students who successfully complete the course will be able to: ? demonstrate an understanding of the fundamentals of (feedback) control systems. ? determine and use models of physical systems in forms suitable for use in the analysis and design of control systems. ? express and solve system equations in state-variable form (state variable models). ? determine the time and frequency-domain responses of first and second-order systems to step and sinusoidal (and to some extent, ramp) inputs. ? determine the (absolute) stability of a closed-loop control system ? apply root-locus technique to analyze and design control systems. ? communicate design results in written reports.</p>
INSERT INTO dep_course VALUES("112","3","TME-501","Mechanical Vibrations","3","2010-07-10","Core","<p>Construct the equations of motion for free-body diagrams Construct the governing differential equation and its solution for a vibrating mass subjected to an arbitrary force. Solve for the motion and the natural frequency for forced vibration of a single degree of freedom damped or undamped system. Obtain design parameters and indicate methods of solution for a complicated vibratory problem. Solve vibration problems that contain multiple degrees of freedom Solve for the motion and the natural frequency of (1) a freely vibrating single degree of freedom undamped motion and (2) a freely vibrating single degree of freedom damped motion.</p>
INSERT INTO dep_course VALUES("113","3","TME-502","Machine Design I","3","2010-07-10","Core","<p>Distinguish kinematic and kinetic motion Identify the basic relations between distance, time, velocity, and acceleration. Apply vector mechanics as a tool for solving kinematic problems. Create a schematic drawing of a real-world mechanism. Determine the degrees-of-freedom (mobility) of a mechanism. Design basic cam systems.</p>
INSERT INTO dep_course VALUES("114","3","TME-503","Dynamics Of Machine","3","2010-07-10","Core","<p>Mastery of the knowledge in dynamics of planar mechanism. Analyze static and dynamic force analysis of mechanisms. Take notice of importance of the balancing and learn procedures of the basic balancing. Ability to understand the implications of computed results in dynamics to improve the design of a mechanism.</p>
INSERT INTO dep_course VALUES("115","3","TME-504","Manufacturing Science II","3","2010-07-10","Core","<p>An ability for students to identify basic manufacturing processes and to ascertain the types ofproducts that are cost effectively produced with each process. The application of statistical analysis to manufacturing, including the computation of process capability and the understanding of statistical process control. The ability to list major metal alloy systems and their physical characteristics The ability to explain heat treating principles; quenching and tempering, solutionizing and aging, and annealing An ability for student to calculate material deformation energy. An ability to explain and calculate non-elastic (plastic) material behavior.</p>
INSERT INTO dep_course VALUES("116","3","TME-505","Heat and Mass Transfer","3","2010-07-10","Core","<p>Acquire knowledge of heat and mass transfer modes. Analyze the steady as well as unsteady state problems in the field of conduction. Analyze the free/natural convection problems as well as the force convection problems for various geometries Acquire the comprehensive knowledge of heat exchangers. Attain the knowledge of Basic radiation laws as well the shape factor analysis and radiosity and electrical circuit analogy. Acquire sound knowledge mass transfer and various dimensionless numbers</p>
INSERT INTO dep_course VALUES("117","3","TCS-507","Concepts of programming and OOPS","3","2010-07-10","Cross Department","<p>Understand the features of C++ supporting object oriented programming Understand the relative merits of C++ as an object oriented programming language Understand how to produce object-oriented software using C++ Understand how to apply the major object-oriented concepts to implement object oriented programs in C++, encapsulation, inheritance and polymorphism Understand advanced features of C++ specifically stream I/O, templates and operator overloading</p>
INSERT INTO dep_course VALUES("118","3","PME-552","Theory of Machine and design Lab","3","2010-07-10","Core","<p>Practical knowledge on design and analysis of mechanisms for the specified type of motion in a machine. With the study of rigid bodies motions and forces for the transmission systems, Machine kinematics and dynamics can be well understood. Demonstration exercises are provided with wide varieties of transmission element models to understand machine kinematics. Various experiments with governors, gyroscopes, balancing machines and universal vibration facilities are available to understand machine dynamics.</p>
INSERT INTO dep_course VALUES("119","3","PME-555","Heat and Mass Transfer Lab","3","2010-07-10","Core","<p>The expected outcome of Heat &amp; Mass Transfer lab is that the students will be able 1. to practically relate to concepts discussed in the Heat &amp; Mass Transfer course. 2. to conduct various experiments to determine thermal conductivity and heat transfer coefficient in various materials. 3. to select appropriate materials &amp; designs for improving effectiveness of heat transfer. 4. to conduct performance tests and thereby improve effectiveness of heat exchangers. 5. to conduct performance tests and thereby improve effectiveness of refrigeration and air conditioning systems.</p>
INSERT INTO dep_course VALUES("120","3","PCS-557","Application  of programming and OOPS Lab","3","2010-07-10","Cross Department","<p>1.To familiarize the students with language environment. 2. To implement various concepts related to language.</p>
INSERT INTO dep_course VALUES("121","3","TME-601","Operation Research","3","2010-07-10","Core","<p>Identify and develop operational research models from the verbal description of the real system. Understand the mathematical tools that are needed to solve optimisation problems. Use mathematical software to solve the proposed models. Develop a report that describes the model and the solving technique, analyse the results and propose recommendations in language understandable to the decision-making processes in Management Engineering.</p>
INSERT INTO dep_course VALUES("122","3","TME-602","IC Engine","3","2010-07-10","Core","<p>The students will be able to calculate the various stresses and strains for different loading conditions of structures or machines. This subject is the prerequisite of Machine Design. Without getting proper knowledge in this subject the learning of Machine Design is impossible. Solve the problems related to the theory of elasticity, , strength and stiffness, deformations and displacements, strain energy, and load carrying capacity. List different materials and structural elements to the analysis of simple structures. Identify and formulate the structural problem and solve using a range of analytical methods. Predict the behaviour of the solid bodies subjected to various types of loading .</p>
INSERT INTO dep_course VALUES("123","3","TME-603","Machine Design II","3","2010-07-10","Core","<p>Identification of different types of gear systems, design, efficiency and applications. Identify the basic relations between distance, time, velocity, and acceleration. Selection procedure of different types bearing, design procedure, reliability etc. Design procedure of different IC engine components, their material, selection procedure etc.</p>
INSERT INTO dep_course VALUES("124","3","TME-604","Fluid Machinery","3","2010-07-10","Core","<p>Acquire knowledge of impact of jets, turbines and pumps. Analyze the jets, turbines and pump related problems and installation process. Analyze the hydraulic machinery useful in Electricity generation and water distribution system. Acquire the comprehensive knowledge of fluid machinery phenomena that will be used in field work. Attain the knowledge of positive displacement pumps, Lift and Cranes and torque converters. Acquire sound knowledge of impulse turbines, reaction turbines and centrifugal pumps as well as their performance curves.</p>
INSERT INTO dep_course VALUES("125","3","TME-605","Refrigeration and Air Conditioning","3","2010-07-10","Core","<p>Illustrate the fundamental principles and applications of refrigeration and air conditioning system - Obtain cooling capacity and coefficient of performance by conducting test on vapor compression refrigeration systems - Present the properties, applications and environmental issues of different refrigerants - Calculate cooling load for air conditioning systems used for various applications - Operate and analyze the refrigeration and air conditioning systems.</p>
INSERT INTO dep_course VALUES("126","3","THU-608","Principle of Management","3","2010-07-10","Cross Department","<p>Demonstrate critical thinking when presented with managerial problems and express their views and opinions on managerial issues in an articulate way. Understand the major internal features of a business system and the environment in which it operates. Identify and explain the importance of the management process and identify some of the key skills required for the contemporary management practice. Conduct topic and case analysis to apply theoretical concepts. Prepare and present structured presentations and reports.</p>
INSERT INTO dep_course VALUES("127","3","PME-653","Machine Design II Lab","3","2010-07-10","Core","<p>Students should be to able to acquainted with C++ programming so they can design and test machine elements and components.</p>
INSERT INTO dep_course VALUES("128","3","PME 654","Fluid Machinary Lab","3","2010-07-10","Core","<p>Student should be able to understand the performance characteristics of turbines and pumps</p>
INSERT INTO dep_course VALUES("129","3","PME 655","Refrigeration and Air Conditioning Lab","3","2010-07-10","Core","<p>Student should be able to understand refrigeartion and air conditioning system performance, working and construction and able to select cooling equipment</p>
INSERT INTO dep_course VALUES("130","3","TME-701","CAD/CAM","3","2010-07-10","Core","<p>Student should be able to develop solutions related to design and manufacturing (with the help of programming and graphic tools). Student should be capable of explaining the concept of CNC programming and machining.</p>
INSERT INTO dep_course VALUES("131","3","TME-702","Maintenance & Safety","3","2010-07-10","Core","<p>Student should be able to anlyze and implement the maintenace of technical systtems that leads towards operational safety of systems.</p>
INSERT INTO dep_course VALUES("132","3","TME-703","Energy Conservation","3","2010-07-10","Core","<p>Student should be able to do analysis of various energy conversion systems. This includes planning of generation and storage. The analysis will include cost, social acceptability as well as environmental consequences.</p>
INSERT INTO dep_course VALUES("133","3","TME-011","Non conventional energy resources","3","2010-07-10","Elective","<p>Students should be to able to understand the limitation of the fossil fuel. Student will be able to explain the harnessing of alternate energy sources like Solar, Hydro, Geothermal, Wind etc.</p>
INSERT INTO dep_course VALUES("134","3","TME-014","Advanced Welding Processes","3","2010-07-10","Elective","<p>student should be able to understand various types of Advance welding processes (Under water welding, Ultrasonic welding Metalization etc.). Choice of advance welding processes , welding positiion and parents metals.</p>
INSERT INTO dep_course VALUES("135","3","PME-751","CAD/CAM Lab","3","2010-07-10","Core","<p>Students should be to able to acquainted with C++ programming to design machine elements and components and NC part programming for machining.</p>
INSERT INTO dep_course VALUES("136","3","PME-752","Industrial Training","3","2010-07-10","Core","<p>Industrial Training helps students to aquaint with actual working environment. Industraining leads towrds the enhancement of personal as well as professional skills.</p>
