INSERT INTO dep_course VALUES("140","3","TME-802","Automobile Engineering","3","2010-07-10","Core","<p>Student should be able to understand and analyze I.C enines parts, Ignition system, Injection system and other componts for identification and investigation of problems and their effective solutions.</p>
INSERT INTO dep_course VALUES("141","3","TME-020","Total Quality Menagement","3","2010-07-10","Elective","<p>Student should be able to explain management processes and methods to improve also to keep up with abrest changes in the field of total quality management.</p>
INSERT INTO dep_course VALUES("142","3","TME-034","Unconventional Manufactring Processes","3","2010-07-10","Elective","<p>Student should be able to explain diferent advance machining processes, their process parameters and appliaction area</p>
