INSERT INTO dep_course VALUES("144","3","PME-853","Project","3","2010-07-10","Core","It demonstrate student's capability to use their theorteical concepts and transform them into a contemporary technical issue.student choose methods and tools and make desciosion during its development.","1","Skill Development","1","","Research","24","knowledge of all subjects of mechanical engineering and their application in the field of engineering","1","2018-04-09 13:02:08");
INSERT INTO dep_course VALUES("145","3","TCE-301","Fluid Mechanics","4","2012-07-10","Core","<p>1. Determine the properties of fluid and pressure and their measurement compute forces on immersed plane and curved plates. 2. Apply continuity equation and energy equation in solving problems on flow through conduits. 3.Compute the frictional loss in laminar and turbulent flows analyse flow between reservoirs.</p>
INSERT INTO dep_course VALUES("146","3","TME-303","Solid Mechanics","4","2012-07-10","Core","<p>1.Apply the principle of virtual work determine deflection of a beam for various loading conditions. 2. Apply unit load method to find the deflection of truss 3.Determine different stresses developed in thick cylinders 4. Visualize the behavior of column for combined bending and axial loading</p>
INSERT INTO dep_course VALUES("147","3","TCE-302","Building Materials & Construction","4","2012-07-10","Core","1. Understand the properties of ingredients of concrete.                          2. To study the behavior of concrete at its fresh and hardened state.                                                                                      3.  Concrete Mix Design          ","1","Skill","1","","Beginner","40","Physical identification of different building materials","1","2018-04-09 13:02:08");
INSERT INTO dep_course VALUES("148","3","TCE-303","Basic Surveying","4","2012-07-10","Core","1. Use conventional surveying tools such as chain/tape, compass, plane table, Theodolite & Dumpy Level.","1","Skill","1","","Beginner","30","Basic Knowledge of Measurement Units & basic Mathematics","1","2018-04-09 13:02:08");
INSERT INTO dep_course VALUES("149","3","TCE-401","Hydraulics & Hydraulic Machines","4","2012-07-10","Core","<p>1. Calculate forces and work done by a jet on fixed or moving plate and curved plates. 2. Apply the working principles of Impulse and Reaction turbines. 3.Select the type of turbine required with reference to available head of water and discharge. 4.Determine the characteristics of centrifugal pump. 5.Apply the working principles of the Reciprocating pump.</p>
INSERT INTO dep_course VALUES("150","3","TCE-402","Structural Analysis-I","4","2012-07-10","Core","<p>1.Use various classical methods for analysis of indeterminate structures. 2. Study the effect of support settlements for indeterminate structures. 3. Apply the concepts of ILD and moving loads on determinate structures. 4.Apply the concept of equivalent UDL determine the reversal of stresses in trusses using ILD. 5. Study About Two and Three Hinge Arches.</p>
INSERT INTO dep_course VALUES("151","3","TCE-403","Advanced surveying","4","2012-07-10","Core","<p>1.Set out curves, buildings, culverts and tunnels. 2.Carry out a geodetic survey, taking accurate measurements using instruments and adjusting the traverse. 3.Apply mathematical adjustment of accidental errors involved in surveying measurements. 4.Plan a survey for applications such as road alignment and height of the building.</p>
INSERT INTO dep_course VALUES("152","3","TCE-404","Engineering Geology","4","2012-07-10","Core","<p>To study about origin and internal and surface structure of earth, mineral and their types, soil material, slope stability, properties of rocks and their types and their effect on sub soil conditions which are encountered during construction.</p>
INSERT INTO dep_course VALUES("153","3","TCE-405","Environmental Engineering-I","4","2012-07-10","Core","<p>1. Identify the source of water and water demand. 2. Apply the water treatment concept and methods. 3. Apply water distribution processes and operation and maintenance of water supply. 4.Repare basic process designs of water and wastewater treatment plants collect, reduce, analyze, and evaluate basic water quality data.</p>
INSERT INTO dep_course VALUES("154","3","TCE-406","Concrete Technology","4","2012-07-10","Core","<p>1.Test all the concrete materials as per IS code. 2. Design the concrete mix using ACI and IS code methods. 3.Determine the properties of fresh and hardened of concrete. 4.Design special concretes and their specific applications. 5.Ensure quality control while testing/ sampling and acceptance criteria.</p>
INSERT INTO dep_course VALUES("155","3","TCE-501","Design Of RC Element","4","2013-07-10","Core","1.Apply the fundamental concepts of working stress method and limit state method.                                                                                                  2.Use IS code of practice for the design of concrete elements.              3.Design the beams, slab, stairs, column and footing.                        4.Draw various RCC structural elements design masonry structures.","1","Skill","1","","Intermediate","42","Knowledge of Structural Ananlysis, Solid Mechanics & Concrete Technology","1","2018-04-09 13:02:08");
INSERT INTO dep_course VALUES("156","3","TCE-502","Structural analysis-2","4","2013-07-10","Core","<p>1.Demonstrate the concepts of qualitative influence line diagram for continuous beams and frames. 2.Apply the methods of indeterminate truss analysis. 3.Demonstrate the behavior of arches and their methods of analysis. 4.Analyze cable suspension bridges. 5.Analyze multistory frames subjected to gravity loads and lateral loads.</p>
INSERT INTO dep_course VALUES("157","3","TCE-503","Hydrology","4","2013-07-10","Core","1.Demonstrate the concepts of hydrograph, S-hydrograph, Unit hydrograph and IUH.                                                                                2.Estimate the hydrological parameters carry out statistical and probability.                                                                                                       3.Analysis of hydrological data.                                                        4.Demonstrate the concepts of hydrological systems.","1","Skill","1","","Beginner","41","Basic knowledge of fluid mechanic principles, Probability","1","2018-04-09 13:02:08");
INSERT INTO dep_course VALUES("158","3","TCE-504","Water resource engg","4","2013-07-10","Core","1.Design various channel systems.                                                               2.Design head and cross regulator structures.                                               3. Identify various types of reservoir and their design aspects.                                                                          4. The understanding of cross drainage works and its design. ","1","Skill","1","","Intermediate","42","Thorough Knowledge of Open Channel Flow","1","2018-04-09 13:02:08");
INSERT INTO dep_course VALUES("159","3","TCE-505","Environmental engg-2","4","2013-07-10","Core","1.Determine the sewage characteristics and design various sewage treatment plants.                                                                                    2.Analyze the status of surface water and ground water quality and the remediation technologies carry out municipal water and wastewater treatment system.                                                                                     3.Design and operation manage hazardous wastes, risk assessment and treatment technologies.                                                                           4. Apply environmental treatment technologies and design processes.","1","Skill","1","","Intermediate","42","Complete knowledge of Environmental Engineering-I and Chemistry","1","2018-04-09 13:02:08");
INSERT INTO dep_course VALUES("160","3","TCE-506","Soil Mechanics and engg geology","4","2013-07-10","Core","<p>1. To explain what Geotechnical Engineering is and how it is important to civil engineering. 2. To explain how three phase system is used in soil and how are soil properties estimated using three phase system. 3. To explain role of water in soil behavior and how soil stresses, permeability and quantity of seepage including flow net are estimated. 4.To determine shear parameters and stress changes in soil due to foundation loads. 5. To estimate the magnitude and time-rate of settlement due to consolidation.</p>
INSERT INTO dep_course VALUES("161","3","TCE-601","Design of RC structures","4","2014-07-10","Core","1. Apply the concepts of liquid retaining structures design material storage structures using various theories.                                                   2. Apply the concepts of environmental and transportation structures.                                                                               3. Demonstrate the detailing of reinforcement.                                          4. Draw the various RCC structures.","1","Skill","1","","Expert","28","Knowledge of RCC Element Design & Concrete Technology","1","2018-04-09 13:02:08");
INSERT INTO dep_course VALUES("162","3","TCE-602","Design of steel elements","4","2014-07-10","Core","<p>1. Apply the IS code of practice for the design of steel structural elements. 2. Design compression and tension members using simple and built-up sections. 3. Calculate forces on the various members of the truss and design them. 4. Analyze the behavior of bolted connections and design them. 5. Design welded connections for both axial and eccentric forces.</p>
INSERT INTO dep_course VALUES("163","3","TCE-603","Foundation engineering","4","2014-07-10","Core","<p>1.To emphasize the importance of soil investigations including destructive and nondestructive methods. 2.To explain how earth pressure theory is important in retaining structure design. 3.To explain the concept of bearing capacity and how to estimate the safe bearing capacity for various foundation system including settlement consideration. 4.To explain how do select a suitable shallow foundation system for various site conditions and also analysis of different foundation system. 5. To explain in what circumstances pile is needed and how do analysis the pile and pile group under various soil conditions.</p>
INSERT INTO dep_course VALUES("164","3","TCE-604","Transportation Engg-1","4","2014-07-10","Core","1. Carry out surveys involved in planning and highway alignment.           2. Design cross section elements, sight distance, horizontal and vertical alignment.                                                                                                    3. Implement traffic studies, traffic regulations and control, and intersection design.                                                                                           4. Determine the characteristics of pavement materials.                                 5. Design flexible and rigid pavements as per IRC.","1","Skill","1","","Beginner","42","concept and fittinngs of curves in Surveying","1","2018-04-09 13:02:08");
INSERT INTO dep_course VALUES("165","3","TCE-605","Theory & Application Of GIS & GPS","4","2014-07-10","Core","<p>1. To know about the principles of remote sensing and spectral signatures. 2. To know about satellites, types of remote sensing and digital image processing. 3. To study about the history and components of GIS &amp; GPS. 4.To know the applications of remote sensing and GIS.</p>
INSERT INTO dep_course VALUES("166","3","TCE-606","Principles of management","4","2014-07-10","Core","<p>1.demonstrate the nuances of management functions. 2.analyze the framework of a business organization. 3.adopt an empirical approach toward business situations. 4.apply various Project Management techniques implement roles of team players.</p>
