INSERT INTO dep_course VALUES("279","3","TEC-405","Communication Engineering","7","2010-07-10","Cross Department","<p>1.Understanding the mathematical and theoretical analysis of amplitude modulation. 2. To study the time division multiplexing and different error associated with amplitude modulation system. 3. To study the mathematical and theoretical analysis angle and frequency modulation system. 4. To study the different pulse modulation and line coding techniques. 5. Understanding of different noise in communication system.</p>
