INSERT INTO dep_course VALUES("288","3","TCS-507","Concept of Programming & OOPs","7","2011-07-10","Cross Department","<p>1. Understood the basic concepts used in operating systems, such as processes, IPC, pipes, file I/O and threads. Also have understood the problems of deadlocks and starvation in operating system, and how to handle them. 2. Have acquired good programming skills, and understood good programming practices And be able to solve problems and program proficiently using the high level and low level Language. 3. Design a highly secure distributed systems, and understanding of the principles behind these techniques, so as to make sound judgments during systems and software design. 4. Identify and describe the function assemblers, compiler, interpreter, linker etc. and to design a new plat form for windows and linux based operating systems.</p>
