INSERT INTO dep_course VALUES("300","3","PEE-653","Power Electronics Lab","7","2011-07-10","Core","1.Able to understand various Power Electronics devices such as SCR, TRIAC, DIAC, IGBT, GTO etc.                                                            2.Able to understand application of aforesaid Power Electronics devices in Choppers, Inverters and Converters etc                                       3.Able to understand control of Electrical Motors through DC-DC converters, AC Converters etc                                                                           4.Able to understand the use of Inductors and Capacitors in Choppers, Inverters and Converters","1","Skill","1","","Beginner","20","","1","2018-04-09 13:02:08");
