INSERT INTO dep_course VALUES("303","3","TEE-701","Switchgear & Protection","7","2012-07-10","Core","<p>1. Student gains knowledge on different Protective Equipments or Power Systems 2.Different applications of the relays, circuit breakers, grounding for different elements of power system is also discussed in the subject 3.Ability to discuss recovery and Restriking. 4. Classification of types of testing station &amp; equipments, testing procedure, direct and indirect testing. 5. Analyze the types of fault on transformers,implementing percentage differential protection, Ungrounded neutral system, grounded neutral system and selection of neutral grounding.</p>
INSERT INTO dep_course VALUES("304","3","TEE-702","ANN & Fuzzy Logic","7","2012-07-10","Core","<p>1. Understand the working concept of biological neural network, Neuron, Nerve structure and synapse and architecture 2. Analyze the basic concept &amp; principal of different ANN learning method 3. Describes the basic concept &amp; technique of Fuzzyfications &amp; Defuzzifications 4. Understand the basic Application of neural network 5. Introduction to neuro &amp; fuzzy logic controller</p>
INSERT INTO dep_course VALUES("305","3","TEC-701","Optical Fibre Communication System","7","2012-07-10","Cross Department","<p>1.Understand the propagation of light in optical fiber. 2.Understand the principles governing optical sources and amplifiers used in optical communications 3.Design optical communication systems to serve a defined purpose. 4.Analyze optical systems for performance and utility. 5.Critical review and summarize modern topics in optical communications. 6.Familiarize with application of optical fiber in telecommunications.</p>
INSERT INTO dep_course VALUES("306","3","TEE-011","Utilization of Electrical Energy & Traction","7","2012-07-10","Core","<p>1.An understanding of the concepts on fundamentals of illumination and the design of lighting schemes. 2. Able to maintain electric drives used in an industries 3. Understanding of the terms used in discussing electric heating to state at the outset that the words heat, potential, etc., are employed more specifically than has generally been found necessary in discussing heat effects apart from electricity.</p>
INSERT INTO dep_course VALUES("307","3","TOE-01","Non-Conventional Energy Resources","7","2012-07-10","Core","<p>1.Study various non-conventional sources of energy like wind, biomass etc and its applications in remote areas of the country. 2. Understand the working criteria of various direct energy conversion systems and study its applications. 3. Understand and pursue further research work behind the development of non conventional energy sources as a part of their research work. 4. Understand the indirect conversion method and wind energy 5. To understand the energy conversion by ocean and tides from sea and biomass</p>
INSERT INTO dep_course VALUES("308","3","PEE-751","Power System Lab","7","2012-07-10","Core","<p>1.Able to understand the principle of protective schemes and various faults in the Power system Scenario. 2.Able to examine protection of power system with various protection relays 3.Able to study the various types of the circuit breakers, the arc quenching phenomena and the protection against over voltages</p>
INSERT INTO dep_course VALUES("309","3","PEC-751","OFC Lab","7","2012-07-10","Cross Department","<p>1.This laboratory course will enable students to relate what they have learnt in classroom to practical, hands-on experiments that will be performed in a fiber optic communication laboratory. 2. Take away the fear factor by providing experience of operating various equipment. 3. Establish good practices in experimentation including accurate data collection, and critical thinking, analysis of data, and sources of error. 4.Learn to write lab reports</p>
INSERT INTO dep_course VALUES("310","3","PEE-753","Industrial Training Seminar","7","2012-07-10","Core","1.It will involve documentation of technical activities of some prominent industry/company in electrical/ power industry by a group of students (not more than 4). Students must deliver a seminar on current
INSERT INTO dep_course VALUES("311","3","PEE-754","Project","7","2012-07-10","Core","1.The project is intended to develop and test complete understanding of various advancements in electrical / power relatedTechnologies for practical real life applications. Proper project work is necessary for over all development of the student. Its need cannot be over emphasized for improving employability of the students. Students must work for at least 50 hours to develop the project. Project topic must be decided within first two weeks of the start of the semester.","1","Skill","1","","","0","","1","2018-04-09 13:02:08");
INSERT INTO dep_course VALUES("312","3","TEE-801","Electric Drives","7","2012-07-10","Core","<p>1. The course aim at linking concepts of power electronics &amp; speed control of various electrical motors. 2. Student can be able to operate various dc &amp; ac motors using power electronic controllers.</p>
INSERT INTO dep_course VALUES("313","3","TEE-802","SCADA & Energy Management","7","2012-07-10","Core","<p>1.Understand the working concept of supervisory control &amp; Overview of the methods of data acquisition systems 2. Analyze the basic concept of Architecture of SCADA 3. Understand the basic concept of Operator consoles and VDUs. 4. Describes the basic concept &amp; technique of SCADA system structure 5. Introduction to Functions performed at a centralized management center</p>
