INSERT INTO dep_course VALUES("315","3","TEE-033","EHV AC & DC Transmission","7","2012-07-10","Core","<p>1. To deal with the importance of HVDC Transmission and HVDC Converters 2.To deal with power conversion between Ac to DC and DC to AC. 3. To deal with firing angle of HVDC System 4.To deal with Reactive power control of HVDC system 5. To deal with Power factor improvement of HVDC system</p>
INSERT INTO dep_course VALUES("316","3","PEE-851","Electric Drives Lab","7","2012-07-10","Core","<p>1. Analyze electrical motor drives and their sub systems (converters, rotating machines and loads) 2.choose a suitable rotating machine for an electrical motor drive 3. Suitable power electronic converter structure for an electrical motor drive 4. Suitable control structure and calculate control parameters for an electrical motor drive</p>
INSERT INTO dep_course VALUES("317","3","PEE-852","Project","7","2012-07-10","Core","1. The project is intended to develop and test complete understanding of various advancements in electrical/ power related Technologies for practical real life applications. Proper project work is necessary for over all development of the student. Its need cannot be over emphasized for improving employability of the students. Students must work for at least 100 hours to develop the project. Project topic must be decided within first two weeks of the start of the semester.","1","Employablility","1","","","0","","1","2018-04-09 13:02:08");
