INSERT INTO dep_course VALUES("319","3","TMA-101","Engineering Mathematics I","8","2009-07-10","Core","<p>Understand the use of matrix algebra techniques, application of derivatives in more than one variable and also find the derivatives of higher orders. Have a fundamental understanding of double integration, triple integration and visualize the concept of volume.</p>
INSERT INTO dep_course VALUES("320","3","TMA-201","Engineering Mathematics II","8","2009-07-10","Core","<p>Have the ability to solve integer problems effectively, and apply the properties of integers for computer applications. Take Laplace transformation of different types of functions, derivatives and integrals, and how it converts complex systems into simple algebraic equations to find out solutions.</p>
INSERT INTO dep_course VALUES("321","3","THM-101","Basic  Technical  Communication","8","2009-07-10","Core","<p>Able to use all four skills of communication i.e. listening, Speaking, reading and writing. To understand the different aspects of writing skills with functional grammar syntax concord, paragraph construction, precis writing and various forms of written communication to express oneself and also enables them to learn the latest trends in business and informal letter writing.</p>
INSERT INTO dep_course VALUES("322","3","THM-201","Advanced  Technical  Communication","8","2009-07-10","Core","<p>To understand the basics of technical communication and different styles in technical writing i.e. scientific articles, Technical articles, Thesis and dissertation and its importance in their life. To understand the essentials of technical proposals and technical reports and their importance in professional life.</p>
INSERT INTO dep_course VALUES("323","3","TPH-101/20","Engg Physics","8","2009-07-10","Core","<p>To understand the concept of frames and then special theory of relativity, the superconductor state &amp; its use in different field of science and technology, ability to learn the behavior of dia para and ferro magnetic materials and its applications, able to understand the principle, working and designation of different LASER use and applications of LASER.</p>
INSERT INTO dep_course VALUES("324","3","TCY-101/20","Engg Chemistry","8","2009-07-10","Core","<p>Apply their knowledge for industrial use like softening of water, Polymers, Alloys, Nanocomposits, Cement, prevention of Corrosion, Glasss, Fuels, Lubricants &amp; analysis by titrations, mass spectrometery &amp; spectroscopy.</p>
INSERT INTO dep_course VALUES("325","3","TEE-101/20","Basic  Electrical  Engineering","8","2009-07-10","Cross Department","<p>Able to understand both DC &amp; AC circuits analysis, Acquire knowledge of different supply systems like DC, Single andThree phase AC, along with their relationship between the parameters.</p>
INSERT INTO dep_course VALUES("326","3","TCS-101/20","Fundamentals Computer and Programming","8","2009-07-10","Cross Department","<p>Develop the skill of interacting with machine through high level programming language and develop the understanding of computer artitecture.</p>
INSERT INTO dep_course VALUES("327","3","TME-101","Basic Mechanical Engineering","8","2009-07-10","Cross Department","<p>Identify an appropriate structural system to studying a given problem and isolate it from its surroundings, model the problem by using free-body diagrams and model various types of loading and support conditions that act on structural systems by using accurate equilibrium equations. Able to understand problem solving fundamentals (e.g., units, dimensional homogeneity, and graphing).</p>
INSERT INTO dep_course VALUES("328","3","TEC-101/20","Fundamentals of Electronics Engineering","8","2009-07-10","Cross Department","<p>Able to understand the fundamentals of semiconductors material, devices and their characterstics, working principles of electronic circuits e.g. Rectifiers, clipper, Clamper etc., the circuit operation of operational amplifier, basic knowledge of logic gate, famili</p>
