INSERT INTO dep_course VALUES("331","3","PCY-101/20","Chemistry Lab","8","2009-07-10","Core","<p>Able to apply various analytical methods viz. titrations, chromatographic techniques &amp; safely use of chemicals.</p>
INSERT INTO dep_course VALUES("332","3","PWS-101/20","WorkShop Practice","8","2009-07-10","Cross Department","<p>Develop the skill of Identify the hand tools, instruments, their use &amp; measuring skill. To understand applications of hand tools and power tools. Develop the skill of selection of appropriate tools required for specific operation and during operation safety measures required to be taken while using the tools.</p>
INSERT INTO dep_course VALUES("333","3","PED-101/20","Engineering Drawing","8","2009-07-10","Cross Department","<p>Able to understand the theory of projection &amp; use of different drafting tolls. Able to improve their visualization skills so that they can apply these skills in developing new products.</p>
