INSERT INTO dep_course VALUES("335","3","PME-101/20","Basic Mechanical Engineering Lab","8","2009-07-10","Cross Department","<p>Understand basics of heat transfer, refrigeration and internal combustion engines</p>
INSERT INTO dep_course VALUES("336","3","PEE-101/20","Basic  Electrical  Engineering Lab","8","2009-07-10","Cross Department","<p>Students are able to measure voltage (AC/DC), Current (AC/DC), frequency, power, voltage peaks &amp; phase difference.</p>
INSERT INTO dep_course VALUES("337","3","PEC-101/20","Fundamentals of Electronics Engineering  Lab","8","2009-07-10","Cross Department","<p>To be able to use basic electronic components and devices used for various electronic circuits.</p>
INSERT INTO dep_course VALUES("338","3","TEC- 501","AUTOMATIC CONTROL SYSTEMS","5","2011-07-10","Core","<p>To develop the basic understanding of control system theory and its role in engineering design . To familiarize the inputs , outputs and building blocks of a control system to differentiate between open  loop and closed loop control system. To understand utility of Laplace transforms and transfer functions for modeling complex interconnected systems. To understand concept of poles and zeros of a transfer function and how they affect the physical behavior of a system . To understand the concept of time domain and frequency domain analysis and to determine the physical behavior of systems using these analysis. To understand state variable analysis of systems and the relationship with state variable representation and transfer functions</p>
INSERT INTO dep_course VALUES("339","3","TEC-502","DIGITAL SIGNAL PROCESSING","5","2011-07-10","Core","<p>Get the response of the discrete time LTI systems. Get the response of linear phase systems and all pass systems. Design Digital filter and realize the structures. Understand DFT and convolution concepts.</p>
INSERT INTO dep_course VALUES("340","3","TEC-503","VLSI Technology","5","2011-07-10","Core","<p>Analyze various processing steps involved in IC Fabrication and explain the fabrication process of any monolithic devices . Understand the Photo lithography and Its types in the IC fabrication Process. Learn about Ion Implantation, Diffusion and oxidation in the fabrication process. Metallization in the Fabrication process of the MOSFET. Understand the Epitexy, Eaching process in the fabrication process.</p>
INSERT INTO dep_course VALUES("341","3","TEC-504","Microprocessor & Controllers","5","2011-07-10","Core","<p>Design circuits for various applications using microprocessors and microcontrollers An in-depth knowledge of applying the concepts on real- time applications. Solid foundation on interfacing the external devices to the processor and controllers according to the user requirements to create novel products and solutions for the real time problems. Train the students for industrial environment aware of excellence guidelines and lifelong learning needed for a successful professional career in embedded and real time system design . To expose the students to design work where there is no single correct solution, rather competing objectives; and to encourage cooperative team work and develop communication skills.</p>
INSERT INTO dep_course VALUES("342","3","TEC-505","Antenna And Wave Propagation ","5","2011-07-10","Core","<p>Have a fundamental understanding of how antenna converts the electrical energy to electromagnetic wave and vice versa. Have an idea of communication of information from source to destination and to understand the basic theory of electromagnetic waves traveling from transmitter to receiver. Describe the various types of transmitting and receiving antennas recently in use and to design different types of antennas. Describe atmospheric and terrestrial effects on radio wave propagation and influence of ionosphere on propagation.</p>
INSERT INTO dep_course VALUES("343","3","TEC- 507","Concepts Of Programming And Oops","5","2011-07-10","Cross Department","<p>Understood the basic concepts used in operating systems, such as processes, IPC, pipes, file I/O and threads. Also have understood the problems of deadlocks and starvation in operating system, and how to handle them. Have acquired good programming skills, and understood good programming practices And be able to solve problems and program proficiently using the high level and low level Language. Design a highly secure distributed systems, and understanding of the principles behind these techniques, so as to make sound judgments during systems and software design. Identify and describe the function assemblers, compiler, interpreter, linker etc. and to design a new plat form for windows and linux based operating systems. Design an embedded real time operating systems using Dos, Windows and Linux based system especially in electronic automotive design areas.</p>
INSERT INTO dep_course VALUES("344","3","TEC-601","Microwave Techniques ","5","2011-07-10","Core","<p>Understand the basic properties and application areas of microwaves, analyze the transmission lines, analyze the waveguides, analyze the microwave networks . Be able to apply analysis methods to determine circuit properties of passive/active microwave devices. Know how to model and determine the performance characteristics of a microwave circuit or system. Have knowledge of transmission and waveguide structures and how they are used as elements in impedance matching and filter circuits for development of real time applications</p>
INSERT INTO dep_course VALUES("345","3","TEE-602","Control System","5","2011-07-10","Core","1. Acquire a working knowledge of system science-related mathematics                                                                            2. Determine the response of different order systems for various inputs signal                                                               3. Analysis of stability & criteria for which the system is stable for different system                                                                           4.Analysis and correlation between the time domain and frequency domain analysis and the different method to analyze the system in frequency domain","1","Skill Development","1","","Intermediate","40","knowledge of system engineering concepts","1","2018-04-09 13:02:08");
INSERT INTO dep_course VALUES("346","3","TEC-602","VLSI Circuit Design ","5","2011-07-10","Core","<p>Analyze various IC Designing Phase involved in IC Designing through designing Flow chart. Designing of various Digital System using CMOS Mosfet with different scaling. Design a combinational circuit for any complex problems and implement it using CMOS/Transmission gate/CPL. Apply the knowledge of CMOS technology to design a sequential circuit for any problems which can be simplified using Boolean algebra and draw the lay out using any modern tool. Evaluate how GaAs technology enhances the performance of the digital device design.</p>
INSERT INTO dep_course VALUES("347","3","TEC-603","Telecommunication Switching Systems ","5","2011-07-10","Core","<p>They should be able to use different protocols for different networks. Student should be able differentiate the requirement of various networks various switching systems . Different signaling Techniques like In channel signaling and common channel signaling various data communication networks</p>
INSERT INTO dep_course VALUES("348","3","TEC-604","Digital Communication ","5","2011-07-10","Core","<p>Understand the random process and the signal space concepts of signals in detail Study and analyze the detection and estimation process in digital communication. Study the concepts of sampling and pulse modulations. Understand the concepts of Inter Symbol Interference and the design of equalizers Study and analyze the different digital modulation schemes.</p>
INSERT INTO dep_course VALUES("349","3","TCS-607","Data Structures using C++ ","5","2011-07-10","Cross Department","<p>Identify, understand and determine the usage of various data structures, operations and associated algorithms. Analyze and compare the efficiency ofalgorithms. Implement applications using basic datastructures such as array, stack, queue andlinked list. Understand the concept of trees and graphs andtheir implementation using basic datastructures and algorithms. Able to implement standard algorithms for searching and sorting.</p>
INSERT INTO dep_course VALUES("350","3","THU-608","Principles Of Management ","5","2011-07-10","Cross Department","<p>To impart a sound knowledge of the structure and functions of Indian Financial system. To enable the students to analyze current economic issues related to and evaluate the New Economic Policy of India (LPG Policy). To give the students an orientation to Indian Public Finance. To teach the fundamentals of National Income estimates. To enable the students to analyze the problems of inflation and BOP in the country To acquaint the students with some of the major issues in International Economics</p>
INSERT INTO dep_course VALUES("351","3","TEC-701","OPTICAL FIBRE COMMUNICATION SYSTEMS ","5","2012-07-10","Core","<p>Understand the propagation of light in optical fiber. Understand the principles governing optical sources and amplifiers used in optical communications. Design optical communication systems to serve a defined purpose. Analyze optical systems for performance and utility. Critical review and summarize modern topics in optical communications. Familiarize with application of optical fiber in telecommunications.</p>
INSERT INTO dep_course VALUES("352","3","TEC-702 ","WIRELESS COMMUNICATION SYSTEMS","5","2012-07-10","Core","<p>Communications with a focus on modern digital communications theory and systems. Emphasize on modern digital data transmission concepts and optimization of receivers. Build a basis for subsequent related courses such as wireless, cellular and mobile communications. Understand fundamental bounds on information theory, and to develop new system concepts. Understand the processes happening in a radio environment and how it is manipulated to better communication technology. Distinguish different multiple access techniques and its evolution to Hybrid Schemes. Understand the basic principles of GSM &amp; CDMA technology</p>
INSERT INTO dep_course VALUES("353","3","TEC-703 ","SATELLITE COMMUNICATION","5","2012-07-10","Core","<p>Understand the communication satellite mechanics. Know about the satellite internal sub systems for communication applications. Know about the principles of GPS. Understand various constellations of satellite and their applications. Familiarize with Home Receiver Outdoor Unit (ODU)  Home Receiver Indoor Unit (IDU). Identify the of uplink Power requirements for FDMA &amp; TDMA</p>
INSERT INTO dep_course VALUES("354","3","PEC752","INDUSTRIAL INTERACTION LAB","5","2012-07-10","Core","Industrial visit to know the working standards, process and procedures involved in an industry. Students are sent for internship/ industrial training of 4 Weeks during the program. Industry personnel are invited to the College to discuss about the current standards and trends in the relevant core areas and the expectation of the industry from the students. This type of seminar helps the students to get updated in the field of interest. Training program on the industry used modern tools is offered to the students like Lab View training, ORCAD etc. Students are able to realize the real environment of industry.","1","Focus On Employability / Entrepreneurship / ","1","","Expert","16","5-6 Weeks","1","2018-04-09 13:02:08");
INSERT INTO dep_course VALUES("355","3","PEC751","PROJECT ","5","2012-07-10","Core","To estimate the ability of the student in transforming the theoretical knowledge studied so far into application software. For enabling the students to gain experience in organization and Implementation of a small project and thus acquire the necessary confidence to carry out main project in the final year. To understand and gain the knowledge of software engineering practices, so as to participate and manage large software engineering projects in future. The Project helps the students to get updated in the field of interest. The students have learnt software of their interest. Students were able to publish papers in various international & National journals like IEEE & Springer.","1","Focus On Employability / Entrepreneurship ","1","","Expert","16","Need to know the basics of electronics and capable to handle the hardware and software","1","2018-04-09 13:02:08");
INSERT INTO dep_course VALUES("356","3","PEC-753 ","OFC & VLSI SIMULATION LAB","5","2012-07-10","Core","<p>Knowledge of the design and implementation of CMOS digital/analog circuits using SPICE modeling. Optimization of the circuit design with respect to area, performance and power. Usage of CAD tools for analog and digital circuit design. Students can understand the logical properties of flip-flops and how to design counters, adders, sequence detectors and similar circuits. Students can understand to set up Fiber Optic Analog link. Familiarize with set up fiber Optic Digital link.</p>
INSERT INTO dep_course VALUES("357","3","TEC 011 ","DIGITAL SYSTEM DESIGN USING VHDL","5","2012-07-10","Elective","Ability to use computer-aided design tools for design of complex digital logic circuits. Ability to model, simulate, verify, and synthesize with hardware description languages. Ability to design and prototype with programmable logic. Familiarize with UART Design. Ability to understand application of Floating Point Arithmetic. Analyzed Designing with programmable Gate Arrays","1","Focus On Employability / Entrepreneurship Xilinx","1","","Expert","40","Basic Knowledge of Digital Electronic Design Aspects","1","2018-04-09 13:02:08");
INSERT INTO dep_course VALUES("358","3","TEC 012   ","ARTIFICIAL NEURAL NETWORKS AND FUZZY LOGIC","5","2012-07-10","Elective","To expose the students to the concepts of feed forward neural networks. To provide adequate knowledge about feedback neural networks. To teach about the concept of fuzziness involved in various systems. To provide comprehensive knowledge of fuzzy logic control and adaptive fuzzy logic. Related algorithms and Design the required and related systems. To provide adequate knowledge about fuzzy set theory.","1","Focus On Employability / Entrepreneurship ","1","","Advance Research","40","basic knowledge of the nural system ","1","2018-04-09 13:02:08");
INSERT INTO dep_course VALUES("359","3","TEC 013   ","PRINCIPLES OF SECURE COMMUNICATION","5","2012-07-10","Elective","<p>Differentiating between laws and ethics in information security. Assessing ethical and professional issues relevant to information security. Analyzing international laws and their legal bodies. Distinguishing between unethical and illegal behavior. Describing the functions of and relationships among laws, regulations and professional organizations in information security. Interpreting organizations liability and the role of counsel</p>
INSERT INTO dep_course VALUES("360","3","TEC 014 ","MOBILE COMPUTING","5","2012-07-10","Elective","Acquaint the students with the application of networking. Understand the various TCP/IP protocols and the working of ATM and its performance. Understanding the principles of MANET. Understanding various kinds of Protocols & Tools. Familiarize with mobile network layer. Understanding various Hidden and Exposed MAC terminals","1","Skill Development","1","","Expert","40","Basic Knowledge of  Wireless Communication System","1","2018-04-09 13:02:08");
INSERT INTO dep_course VALUES("361","3","TOE-01 ","NON-CONVENTIONAL ENERGY RESOURCES","5","2012-07-10","Elective","<p>To use different renewable energy sources to produce electrical power. To minimize the use of conventional energy sources to produce electrical energy. Identify the fact that the conventional energy resources are depleted. To store energy and to avoid the environmental pollution. Familiarize with Fuel Cells. Understanding Principle of working, performance and limitations of Thermo electric Conversions.</p>
INSERT INTO dep_course VALUES("362","3","TEC 801   ","RADAR & NAVIGATION","5","2012-07-10","Core","<p>Demonstrate an understanding of the factors affecting the radar performance using Radar Range Equation. Analyze the principle of FM-CW radar and apply it in FM- CW Altimeter. Differentiate between a MTI Radar and a Pulse Doppler Radar based on their working principle. Demonstrate an understanding of the importance of Matched Filter Receivers in Radars. Familiarize with the different types of Radar Displays and their application in real time scenario. Understand the essential principles of operation ofradarsystems.Understand the basic concept ofRadarand applications of various types.</p>
INSERT INTO dep_course VALUES("363","3","PEC851","PROJECT","5","2012-07-10","Core","To estimate the ability of the student in transforming the theoretical knowledge studied so far into application software. For enabling the students to gain experience in organization and Implementation of a small project and thus acquire the necessary confidence to carry out main project in the final year. To understand and gain the knowledge of software engineering practices, so as to participate and manage large software engineering projects in future. The Project helps the students to get updated in the field of interest. The students have learnt software of their interest. Students were able to publish papers in various international & National journals like IEEE & Springer.","1","Focus On Employability / Entrepreneurship ","1","","Expert","20","Familiar with hardware and software","1","2018-04-09 13:02:08");
INSERT INTO dep_course VALUES("364","3","TEC-802 ","DATA COMMUNICATION NETWORKS","5","2012-07-10","Core","<p>Have a fundamental understanding of the network services and layered architecture. Have a good knowledge about the different LAN networks. Applying the different routing methods in different networks. Have an understanding about ATM networks and internetworking with ATM. Describe basic concepts and algorithms of cryptography, including encryption/decryption and security services and develop a security model to prevent, detect and recover from attacks. Understand the concept of Resource Sharing.</p>
INSERT INTO dep_course VALUES("365","3","PCS-854 ","CAD OF ELECTRONICS LAB","5","2012-07-10","Core","<p>Students will be able to apply switching theory to the solution of logic design problems. Students can understand the logical properties of flip-flops and how to design counters, adders, sequence detectors and similar circuits. Students will be able to program various digital circuits in different models using Verilog. Students will be able to draw layouts using IC station tool.</p>
INSERT INTO dep_course VALUES("366","3","TEC 022 ","RELIABILITY ENGINEERING","5","2012-07-10","Elective","<p>Differentiate between qualities, availability, and maintainability. Understand Reliability Mathematics related concepts like Classical set theory, Boolean algebra, sample space. Definition of probability, basic properties of probability, conditional probability, and random variables. Familiarize with various kinds of probability distribution. Familiarize with electronic system reliability. identify cause of failure and eliminate in design</p>
INSERT INTO dep_course VALUES("367","3","TEC 021   ","SPREAD SPECTRUM SYSTEMS","5","2012-07-10","Elective","This subject contributes to the programme outcome through the teaching of the  providing students with computer exercises to simulate, to process theories and concepts underlying spread spectrum techniques to analyze multicarrier communication techniques.  Perform the time and frequency domain analysis of the signals in a digital communication system. Analyze Performance of spread spectrum communication system","1","Skill Development","1","","Expert","40","Basic communication system","1","2018-04-09 13:02:08");
INSERT INTO dep_course VALUES("368","3","TEC-023 ","SELECTED TOPICS IN COMMUNICATION","5","2012-07-10","Elective","Subject contributes to the programme outcome through the teaching of the MIMO-OFDM. Differentiate dynamic and opportunistic wireless access from static long term access. Understand and explain common SDR and CR hardware and networks architectures.  Demonstrate knowledge of spectrum sensing approaches developed for CRN. Be able to carry out simple analysis of primary user detection. Demonstrate knowledge of MAC protocols developed for CRN familiar with SDR/CRN standards.","1","Skill Development","1","","Advance Research","40","Basic communication system","1","2018-04-09 13:02:08");
INSERT INTO dep_course VALUES("369","3","TEC 024 ","DIGITAL IMAGE PROCESSING","5","2012-07-10","Elective","Understand image fundamentals and the various steps in digital image processing. Understand various image transforms. Understand various image enhancement, segmentation and compression techniques. Get the response of the discrete time LTI systems. Acquire an appreciation for the image processing issues and techniques and be able to apply these techniques to real world problems. Be able to conduct independent study and analysis of image processing problems and techniques.","1","Skill Development Matlab & Matlab Simulink","1","","Expert","40","basic knowledge of signal and system & digital signal processing","1","2018-04-09 13:02:08");
INSERT INTO dep_course VALUES("370","3","TEC 031 ","RANDOM SIGNAL THEORIES","5","2012-07-10","Elective","Review of random processes. Innovation representation of a stationary random process. Students can understand the basics of probability, events, sample space and how to use them to real life problems. Understanding of Power density spectrum and its properties. Analyzethe given probabilistic model of the problem. Understanding the types of noise, relationship between temperature and noise how to eliminate the noise.","1","Skill Development","1","","Expert","40","Random variable","1","2018-04-09 13:02:08");
INSERT INTO dep_course VALUES("371","3","TEC 032   ","OPTICAL NETWORKS","5","2012-07-10","Elective","<p>Design optical amplifiers and modulators . Analyze optical networks. Familiarize with optical components. Familiarize with SDH/SONET. Analyze optical flow switching (OFS) and its implications on physical and higher layer architectures. Familirize OTDM &amp; Optical Synchronization</p>
INSERT INTO dep_course VALUES("372","3","TEC-301","ELECTRONICS DEVICES & CIREUITS","5","2010-07-10","Core","<p>To Understand diamagnetic, paramagnetic, ferromagnetic antiferromagnetic and ferry-magnetic materials properties. To understand the BJT, hybrid parameters and high frequency model. To understand the basic concept of feedback system, analysis of Different types of feedback and principle of oscillator and its types. To understand and analyze the multistage amplifier system. Study the multivibrator and its application.</p>
INSERT INTO dep_course VALUES("373","3","TEE-301","Network Analysis and Synthesis","5","2010-07-10","Core","<p>1.learn how to analyse and solve a circuit using node and mesh analysis. 2.learn how to apply theorems on circuits and selection of appropriate theorem for particular circuits 3.Competence to provide transfer functions, frequency response plots, impulse and step response for different circuits and how to find out the poles and zeros of a transfer function and plot them in the graph 4.Learn to solve huge and very complex, we can&#39;t solve directly,by converting to two port network. 5. learn method of designing signal processing filters</p>
INSERT INTO dep_course VALUES("374","3","TEC-303","Electronic Measurement & Instrumentation","5","2010-07-10","Core","<p>1. Implement scientific notation &amp; metric prefix 2. Student able to design circuit of analog meter for measurement of current, voltage , resistance 3. Understand the basic concept &amp; principal of different analog &amp; digital voltmeter, digital frequency meter 4. Understand the basic concept &amp; working principal of different analog &amp; digital converters, LED &amp; LCD, CRO 5. Understand the basic principal of signal generator and analyzer</p>
INSERT INTO dep_course VALUES("375","3","TEC 302","DIGITAL ELECTRONICS AND DESIGN ASPECT","5","2010-07-10","Core","<p>To study the different number system and their conversion and also to apply them for real life problems. Minimize the digital circuits by simplification of the expression using Boolean algebra and K-Map. To Design and understand the combinational circuits from functional description of digital system. To Design and understand the sequential circuits from functional description of digital system. Design and understand the different logic family like TTL, ECL etc. Identify and prevent various hazards and timing problems.</p>
INSERT INTO dep_course VALUES("376","3","TCS-301","COMPUTER BASED NUMERICAL TECHNIQUE","5","2010-07-10","Cross Department","<p>To Study solution of Algebraic and Transcendental Equation. To study the Interpolation, Newtons forward and backward formula Stirlings, Bessels, Everetts formula. To study the Trapezoidal rule, Simpsons 1/3 and 3/8 rule, Booles rule, Waddles rule. To study the different Curve fitting method and Regression analysis.</p>
INSERT INTO dep_course VALUES("377","3","THU-301","ENGINEERING ECONOMICS","5","2010-07-10","Cross Department","<p>To impart a sound knowledge of simple interest and compound interest factor and Cash flow diagrams, Calculation, Calculation of time value equivalences. To enable the students to analyze Rate of return, Internal rate of return, comparison of IIR with other methods, IRR misconceptions. To give the students an orientation Cost effectiveness analysis. To enable the students to analyze the problems of Depreciation, Break-even analysis and Product and Process Costing</p>
INSERT INTO dep_course VALUES("378","3","TEC 501","ELECTROMAGNETIC FIELD THEORY","7","2010-07-10","Core","<p>To understand the basic coordinate system, their transformation, vector algebra, divergence of a vector and divergence theorem, curl of a vector and Stokess theorem, Laplacian of a scalar. To achieve the understanding and ability to examine static electric fields, time-varying electric fields. To achieve the understanding and ability to examine static magnetic fields, time-varying magnetic fields. To understand the wave propagation in different types of media, Maxwell equation and analysis of uniform wave propagation in free space, dielectric and lossy medium. To understand the basic concept of transmission line and their analyses.</p>
INSERT INTO dep_course VALUES("379","3","TEC 402","ANALOG INTEGRTED CIRCUITS","5","2010-07-10","Core","<p>Understanding the basic concept of the current mirror circuit, the basic MOSFET current source, MOS Current steering circuits, BJT circuits. Understanding of the power amplifier and their analyses. Understanding of 741 OP-AMP and its properties. Small signal analysis of OP-AMP. Design and understanding low pass and band pass filters and their frequency analysis. Design and understanding of multivibrator using IC 741.</p>
INSERT INTO dep_course VALUES("380","3","TEC-404","SIGNALS AND SYSTEMS","5","2010-07-10","Core","<p>To study the properties of continuous-time and discrete-time Linear Time Invariant (LTI) systems. Understanding and analysis of Fourier series its transformation and Properties of Fourier series. Understanding and analysis of Time and Frequency Characterization of Signals and Systems. To study the sampling theorem and Laplace transform, Region of convergence &amp; Unilateral Laplace transform. Understanding of z- transform and its properties.</p>
INSERT INTO dep_course VALUES("381","3","TEC 405","ANALOG COMMUNICATION","5","2010-07-10","Core","<p>Understanding the mathematical and theoretical analysis of amplitude modulation. To study the time division multiplexing and different error associated with amplitude modulation system. To study the mathematical and theoretical analysis angle and frequency modulation system. To study the different pulse modulation and line coding techniques. Understanding of different noise in communication system.</p>
INSERT INTO dep_course VALUES("382","3","TEC 406","SOLID SATE DEVICES AND SEMICONDUCTOR MATERIALS","5","2010-07-10","Core","<p>Analyze the performance of solid state material &amp; its properties. Study and understanding of opto electronic devices. Study about the various high frequency diodes. Understanding and design of power regulator and PLL.</p>
INSERT INTO dep_course VALUES("383","3","PEC-351","ELECTRONICS DEVICES AND CIRCUIT ","5","2010-07-10","Core","<p>Understand and design the basic circuit of FET and study its characteristics. Understand and design the basic circuit of BJT and study its characteristics. Understand and design the basic circuit of Oscillators and study its characteristics. To study the multivibrater circuits and its characteristics. Understanding of Darlington Pair Characteristics. Understanding of multistage amplifier and draw their frequency response.</p>
INSERT INTO dep_course VALUES("384","3","PEC-352","DIGITAL ELECTRONICS LAB ","5","2010-07-10","Core","<p>Understanding of bread board and different logic gates Ics. To design the combinational circuits and verification of the truth table on bread board with the help of Ics. To design the sequential circuits and verification of the truth table on bread board with the help of ICs. Understanding of the CMOS inverter. Knowledge of Schmitt trigger.</p>
INSERT INTO dep_course VALUES("385","3","PEC-451","Analog Integrated Circuit Lab","5","2010-07-10","Core","<p>To study the IC 741 OP AMP and its characterstics. Design the different circuits with the help of IC 741 OP AMP for different applications. Design the oscillator circuit with the help of OP AMP. Design PLL Circuit and Draw its characterstics. Study the 555 timer ICs and its applications.</p>
INSERT INTO dep_course VALUES("386","3","PEC ?452 ","Circuit Design on PCB","5","2010-07-10","Core","<p>Design and understanding to draw a layout on the PCB and fabricates the components on it. Design the multistage amplifier on PCB. Design of different oscillator circuits on PCB. Design of multivibrater, tuned amplifier and A to D and D to A convertor</p>
INSERT INTO dep_course VALUES("387","3","PEC?453 ","Analog Communication Lab","5","2010-07-10","Core","<p>Study and understanding of Amplitude modulation and DSB/SSB and their modulation index. Study different types of FM Receiver and performance. Study PAM and Sampling theorm. Study the different types of Pulse modulation.</p>
INSERT INTO dep_course VALUES("388","3","PEC -551 ","Advanced MP LAB","5","2011-07-10","Core","Study and understanding of assembly programming and their execution with the help of microprocessor 8085 and 8086","1","Skill Development","1","","Intermediate","16","basic of electronics","1","2018-04-09 13:02:08");
INSERT INTO dep_course VALUES("389","3","PEC-552 ","DSP Lab.","5","2011-07-10","Core","Study the different modulation technic  with the help of matlab programming or by simulink. Demonstrate the convolution and FFT algorithm with the help of matlab. Understanding and design of FIR and IIR filter with simulink and matlab.","1","Skill Development","1","","Intermediate","16","basic of electronics","1","2018-04-09 13:02:08");
INSERT INTO dep_course VALUES("390","3","PEC-651 ","Digital Communication","5","2011-07-10","Core","<p>Study and understanding of digital modulation techniques Ask, FSK,and PSK. Study and understanding of PCM transmitter and receiver . Study and understanding of DM and ADM transmitter and receiver circuits. Study and understanding of different line coding and their power spectra. Design and understanding of spread spectrum system.</p>
INSERT INTO dep_course VALUES("391","3","PEC-652","Microwave Lab","5","2011-07-10","Core","Study and check the performance of the microwave frequency in wave guide. Calculate the VSWR with the help of microwave test bench and VSWR meter. Study the different type of microwave devices e. g. Tee junction, Coupler, Attenuator and ferrite devices. Study the performance characterstics of Gunn Diode. Study the radiation pattern of Horn antenna.","1","Skill Development","1","","Intermediate","16","basic of Communication system","1","2018-04-09 13:02:08");
