INSERT INTO ins_department VALUES("1","3","Master of Computer Applications","274","<p>Our vision is to Impart the knowledge of Computer Applications to enable our students to meet the global requirements and challenges.</p>
INSERT INTO ins_department VALUES("2","3","Department of Management Studies","388","<p>To provide the utmost and exemplary prodigal managerial platform by facilitating purposeful and dynamic business education to the students by virtue of which every student could be transformed into a competent professional possessing the acquired managerial outlook . To emerge out as a influential path finder for management professionals where they could utilize their core competencies in producing , processing and efficiently handling the resources . To develop capable management incumbents for professional world of today .</p>
INSERT INTO ins_department VALUES("3","3","Mechanical Engineering","283","<p>We strive for preparing Mechanical Engineering professionals having sound technical knowledge with innovative approach, who are proficient to pursue diverse and flourishing careers in present society</p>
INSERT INTO ins_department VALUES("4","3","Civil Engineering","0","<p>The vision of the Department of Civil Engineering is to achieve unique identity by development of knowledge resources and highly competent Civil Engineers in various fields of Civil Engineering to meet local, national, and global economic and social needs.</p>
INSERT INTO ins_department VALUES("5","3","Electronics & Communication Engineering","191","<p>To impart the high quality technical education to student so they are capable to&nbsp; provide valuable resources for industry and society through excellence in technical education and research.</p>
INSERT INTO ins_department VALUES("6","3","Computer Science & Engineering","116","<p>To achieve global identity in filed of computer science and engineering ,by imparting research and quality training to meet the ever changing requirements of the industry and society.</p>
INSERT INTO ins_department VALUES("7","3","Electrical & Electronics Engineering","0","<p>To achieve global identity in filed of computer science and engineering ,by imparting research and quality training to meet the ever changing requirements of the industry and society.</p>
INSERT INTO ins_department VALUES("8","3","Cross Department - Applied Engineering","0","","","1");
INSERT INTO ins_departments VALUES("1","3","Master of Computer Applications","1","<p>To be the source of bringing out globally competent pioneering computing professionals, researchers, innovators and entrepreneurs and thereby succeed and contribute value to the knowledge-based economy and society.</p>
INSERT INTO ins_departments VALUES("2","3","Department of Management Studies","1","<p>To attain global prominence by developing thought leadership, innovative solutions, and responsible business leaders through flexible, values-based management education driven by high impact research.</p>
INSERT INTO ins_departments VALUES("3","3","Mechanical Engineering","283","<p>The Mechanical Engineering Department endeavors to be recognized globally for outstanding education and research leading to well qualified engineers, who are innovative, entrepreneurial and successful in advanced fields of mechanical engineering to cat</p>","<p>To offer good quality Under-Graduate, Post-Graduate and Doctoral programmes in electrical and electronics engineering To provide state-of-the-art resources that contribute to achieve excellence in teaching-learning, research and development activities To bridge the gap between industry and academia by framing curricula and syllabi based on industrial and societal needs  To provide suitable forums to enhance the creative talents of students and faculty members</p>","1");
INSERT INTO ins_departments VALUES("4","3","Civil Engineering","0","<p>To impart knowledge and execellence in civil engineering and technology with global perspectives to our students and to make them ethically strong engineers to build our nation.</p>
INSERT INTO ins_departments VALUES("5","3","Electronics & Communication Engineering","191","<p>1. To produce globally competitive and socially sensitized Engineering graduates and to establish the dept as a center of excellence by bringing out the professional competence in the core areas of Electronics and Communication Engineering.</p>
INSERT INTO ins_departments VALUES("6","3","Computer Science & Engineering","116","<p>To become a prominent department of Computer Science &amp; Engineering producing competent&nbsp;&nbsp;&nbsp;</p>
INSERT INTO ins_departments VALUES("7","3","Electrical & Electronics Engineering","0","<p>To Impart Knowledge in Electrical Science and Technology to meet the international standards and make the Electrical Engineering ethically and emotionally strong enough to meet the technological challengers for the well being of this country in the coming years.</p>
INSERT INTO ins_departments VALUES("8","3","Cross Department - Applied Engineering","0","","<p>To offer good quality Under-Graduate, Post-Graduate and Doctoral programmes in electrical and electronics engineering To provide state-of-the-art resources that contribute to achieve excellence in teaching-learning, research and development activities To bridge the gap between industry and academia by framing curricula and syllabi based on industrial and societal needs  To provide suitable forums to enhance the creative talents of students and faculty members</p>","1");
INSERT INTO ins_departments VALUES("9","8","demo department","1","","<p>To offer good quality Under-Graduate, Post-Graduate and Doctoral programmes in electrical and electronics engineering To provide state-of-the-art resources that contribute to achieve excellence in teaching-learning, research and development activities To bridge the gap between industry and academia by framing curricula and syllabi based on industrial and societal needs  To provide suitable forums to enhance the creative talents of students and faculty members</p>","1");
