INSERT INTO td_course VALUES("1","CA_1001","Sample Course ","8","JAYA JINDAL","Sample Trainer name","sampletrainer@gmail.com","9856321458","<p><a href="https://en.wikipedia.org/wiki/Human_resource_management">Human resource management</a>&nbsp;regards&nbsp;<strong>training and development</strong>&nbsp;as a function concerned with organizational activity aimed at bettering the&nbsp;<a href="https://en.wikipedia.org/wiki/Job_performance">job performance</a>&nbsp;of individuals and groups in&nbsp;<a href="https://en.wikipedia.org/wiki/Organization">organizational</a>&nbsp;settings. Training and development can be described as &quot;an educational process which involves the sharpening of skills, concepts, changing of attitude and gaining more knowledge to enhance the performance of employees&quot;.<a href="https://en.wikipedia.org/wiki/Training_and_development#cite_note-:0-1">[1]</a>&nbsp;The field has gone by several names, including &quot;Human Resource Development&quot;, &quot;Human Capital Development&quot; and &quot;Learning and Development&quot;.</p>
INSERT INTO td_course VALUES("2","CA_1002","Sample Course ","8","JAYA JINDAL","Sample Trainer name","sampletrainer@gmail.com","9856321458","<p><a href="https://en.wikipedia.org/wiki/Human_resource_management">Human resource management</a>&nbsp;regards&nbsp;<strong>training and development</strong>&nbsp;as a function concerned with organizational activity aimed at bettering the&nbsp;<a href="https://en.wikipedia.org/wiki/Job_performance">job performance</a>&nbsp;of individuals and groups in&nbsp;<a href="https://en.wikipedia.org/wiki/Organization">organizational</a>&nbsp;settings. Training and development can be described as &quot;an educational process which involves the sharpening of skills, concepts, changing of attitude and gaining more knowledge to enhance the performance of employees&quot;.<a href="https://en.wikipedia.org/wiki/Training_and_development#cite_note-:0-1">[1]</a>&nbsp;The field has gone by several names, including &quot;Human Resource Development&quot;, &quot;Human Capital Development&quot; and &quot;Learning and Development&quot;.</p>
INSERT INTO td_course VALUES("3","CA_1003","Sample Course ","8","JAYA JINDAL","Sample Trainer name","jayanthyu@yoursefficiently.com","9856321458","<p>Training and development encompasses three main activities: training, education, and development.<a href="https://en.wikipedia.org/wiki/Training_and_development#cite_note-Harrison-2">[2]</a><a href="https://en.wikipedia.org/wiki/Training_and_development#cite_note-4">[4]</a><a href="https://en.wikipedia.org/wiki/Training_and_development#cite_note-IITD-5">[5]</a></p>
